#5.2)\n","    * [5.3 Analyzing Daily Step Counts ](#5.3)   \n","    * [5.4 Identify relationships](#5.4)\n","    * [5.5 Sleep Efficiency](#5.5)\n","    * [5.6 The use of smart device](#5.6)\n","* [6. Conclusion](#6) "]},{"cell_type":"markdown","id":"60ec235b","metadata":{"papermill":{"duration":0.018497,"end_time":"2024-04-14T12:53:19.302826","exception":false,"start_time":"2024-04-14T12:53:19.284329","status":"completed"},"tags":[]},"source":["# 1. Introduction <a class=\"anchor\" id=\"intro\">\n","\n","Bellabeat, a high-tech manufacturer of health-focused products for women, is poised to become a significant player in the gloval smart device market.\n","\n","Bellabeat's mission is to empower women with knowledge about their health and habits through beautifully designed, technology-driven wellness products. With a range of smart devices including the Bellabeat app, Leaf wellness tracker, Time wellness watch, and Spring water bottle, our products offer users the ability to track and monitor their activity, sleep, stress, menstrual cycle, and mindfulness habits.\n","\n","\n"]},{"cell_type":"markdown","id":"01aa3215","metadata":{"papermill":{"duration":0.018427,"end_time":"2024-04-14T12:53:19.339867","exception":false,"start_time":"2024-04-14T12:53:19.32144","status":"completed"},"tags":[]},"source":["# 2. Ask Phase <a class=\"anchor\" id=\"ask\">\n","\n","**Business task:** <a class=\"anchor\" id=\"Business_task\">\n","\n","The objective is to analyze consumer trends in the usage of non-Bellabeat smart devices, identify relevant behaviors from the data, and apply these insights to inform Bellabeat's marketing strategy for its app.\n","\n","\n","**Question to be answered** <a class=\"anchor\" id=\"Question_to_be_answered\">\n","\n","* What specific trends can be identified in the usage of non-Bellabeat smart devices?\n","* How could these trends apply to Bellabeat customers?\n","* How could these trends help influence Bellabeat marketing strategy?\n","\n","**Key stakeholders** <a class=\"anchor\" id=\"stakeholders\">\n","\n","* Urška Sršen - Bellabeat cofounder and Chief Creative Officer\n","* Sando Mur - Bellabeat cofounder and key member of Bellabeat executive team\n","* Bellabeat Marketing Analytics team\n","\n"]},{"cell_type":"markdown","id":"d2529086","metadata":{"papermill":{"duration":0.018433,"end_time":"2024-04-14T12:53:19.378045","exception":false,"start_time":"2024-04-14T12:53:19.359612","status":"completed"},"tags":[]},"source":["# 3. Prepare Phase <a class=\"anchor\" id=\"Prepare_Phase\">\n","\n","**3.1 Data description:** <a class=\"anchor\" id=\"Data_description\">\n","\n","The FitBit Fitness Tracker Data is a public dataset obtained from 33 Fitbit users who consented to share their personal fitness tracker data. The dataset provides minute-level information on physical activity, heart rate, and sleep monitoring. It offers valuable insights into users' daily habits, including their activity levels, step counts, and heart rate patterns.\n","\n","* Data time frame: 4/12/2016 to 5/9/2016\n","* Data source: The data source used for our case study is FitBit Fitness Tracker Data. This dataset is stored in Kaggle and was make availavle through Mobius.\n","* User consent: The dataset is derived from Fitbit users who voluntarily agreed to share their personal tracker data, ensuring compliance with privacy and data protection regulations.\n","\n","    \n","    \n","| Table Name | Type | Description |\n","| --- | --- | --- |\n","| dailyActivity_merged | Microsoft Excel CSV | Daily Activity over 31 days of 33 users. Tracking daily: Steps, Distance, Intensities, Calories |\n","|dailyCalories_merged | Microsoft Excel CSV | Daily Calories over 31  days of 33 users |\n","| dailyIntensities_merged | Microsoft Excel CSV | Daily Intensity over 31 days of 33 users. Measured in Minutes and Distance, dividing groups in 4 categories: Sedentary, Lightly Active, Fairly Active,Very Active |\n","| dailySteps_merged | Microsoft Excel CSV | Daily Steps over 31 days of 33 users | \n","| heartrate_seconds_merged | Microsoft Excel CSV | Exact day and time heartrate logs for just 7 users |\n","| hourlyCalories_merged | Microsoft Excel CSV | Hourly Calories burned over 31 days of 33 users |\n","| hourlyIntensities_merged | Microsoft Excel CSV | Hourly total and average intensity over 31 days of 33 users |\n","| hourlySteps_merged | Microsoft Excel CSV | Hourly Steps over 31 days of 33 users |\n","| minuteCaloriesNarrow_merged | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users (Every minute in single row)|\n","| minuteCaloriesWide_merged | Microsoft Excel CSV | Calories burned every minute over 31 days of 33 users (Every minute in single column)|\n","| minuteIntensitiesNarrow_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users (Every minute in single row) |\n","| minuteIntensitiesWide_merged | Microsoft Excel CSV | Intensity counted by minute over 31 days of 33 users (Every minute in single column)|\n","| minuteMETsNarrow_merged | Microsoft Excel CSV | Ratio of the energy you are using in a physical activity compared to the energy you would use at rest. Counted in minutes |\n","| minuteSleep_merged | Microsoft Excel CSV | Log Sleep by Minute for 24 users over 31 days. Value column not specified |\n","| minuteStepsNarrow_merged | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users (Every minute in single row)|\n","| minuteStepsWide_merged | Microsoft Excel CSV | Steps tracked every minute over 31 days of 33 users (Every minute in single column) |\n","| sleepDay_merged | Microsoft Excel CSV| Daily sleep logs for 24 users over 31 days, tracked by: Total count of sleeps a day, Total minutes, Total Time in Bed |\n","| weightLogInfo_merged | Microsoft Excel CSV | Weight track by day in Kg and Pounds over 30 days. Calculation of BMI. 5 users report weight manually 3 users not. In total there are 8 users |"]},{"cell_type":"markdown","id":"cf51128f","metadata":{"papermill":{"duration":0.018528,"end_time":"2024-04-14T12:53:19.415106","exception":false,"start_time":"2024-04-14T12:53:19.396578","status":"completed"},"tags":[]},"source":["**3.2Data Credibility and Integrity** <a class=\"anchor\" id=\"Data_Credibility_and_Integrity\">\n","\n","* Sample Size Bias: The difference in sample sizes (31, 24, and less than 10) can introduce bias in the analysis. Smaller sample sizes may have limited statistical power, making it challenging to draw robust conclusions or generalize findings to the larger population.\n","    \n","* Time Frame Bias: The data collected within a specific time frame (31 days from April 12th to May 9th, 2016) may not capture the full picture or be representative of longer-term trends. It's important to consider potential seasonality, temporal patterns, or specific events that might impact the data during this time frame.\n","    \n","* Temporal Bias: The time frame of the data collection (2016) is several years ago, and the dynamics or circumstances related to the data may have changed since then. It is important to consider potential shifts in trends, societal changes, or other factors that could impact the relevance or applicability of the data to the current year .    \n"]},{"cell_type":"markdown","id":"4d05dee3","metadata":{"papermill":{"duration":0.018672,"end_time":"2024-04-14T12:53:19.452156","exception":false,"start_time":"2024-04-14T12:53:19.433484","status":"completed"},"tags":[]},"source":["# 4. Process Phase <a class=\"anchor\" id=\"Process_Phase\">\n","We will choose the packages that will help us on our analysis and open them. We will use the following packages for our analysis:\n","\n","* tidyverse\n","* lubridate\n","* dplyr\n","* ggplot2\n","* ggrepel\n","* tidyr\n","* stats\n","* skimr\n","* knitr    "]},{"cell_type":"code","execution_count":2,"id":"7fb98c78","metadata":{"execution":{"iopub.execute_input":"2024-04-14T12:53:19.528123Z","iopub.status.busy":"2024-04-14T