data":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Calculate the correlation between total steps and calories\n","correlation <- cor(daily_activity_sleep$totalsteps, daily_activity_sleep$totalminutesasleep)\n","\n","# Print the correlation coefficient\n","cat(\"Correlation coefficient between total steps and sleep time:\", correlation)\n","\n","# Create a scatter plot\n","scatter_plot <- ggplot(daily_activity_sleep, aes(x = totalsteps, y = totalminutesasleep, color = totaldistance)) +\n","  geom_point() +\n","  scale_color_gradient(low = \"lightgreen\", high = \"blue\") +\n","  geom_smooth(method = \"loess\", color = \"white\", size = 0.5) +\n","  labs(title = \"Total Steps vs. Minutes asleep\",\n","       x = \"Total Steps\",\n","       y = \"Minutes asleep\") +\n","  theme_bw()\n","\n","# Display the scatter plot\n","print(scatter_plot)"]},{"cell_type":"markdown","id":"43870780","metadata":{"papermill":{"duration":0.034006,"end_time":"2024-04-14T12:53:28.380244","exception":false,"start_time":"2024-04-14T12:53:28.346238","status":"completed"},"tags":[]},"source":["There is a weak negative relationship between total steps and sleep time."]},{"cell_type":"markdown","id":"30a24437","metadata":{"papermill":{"duration":0.033371,"end_time":"2024-04-14T12:53:28.447021","exception":false,"start_time":"2024-04-14T12:53:28.41365","status":"completed"},"tags":[]},"source":["# 5.5 Sleep Efficiency <a class=\"anchor\" id=\"5.5\">\n","    \n","Generally, a sleep efficiency of 85% or higher is considered healthy. Here's a breakdown of different ranges:\n","\n","* 85-89%: This range is typically seen as the lower limit of normal sleep efficiency. While it can be acceptable, there may still be room for improvement.\n","* 90-95%: Falling within this range is considered healthy and optimal for most adults. It indicates that a significant portion of time spent in bed is devoted to actual sleep.\n","* Above 95%: While it may initially appear ideal, very high sleep efficiency could also suggest insufficient time spent in bed, potentially leading to sleep deprivation in certain cases.\n","    \n","Quadra Wellness and Counselling Vancouver. (n.d.). Sleep Efficiency Calculator. Retrieved from [Sleep Efficiency Calculator](https://www.quadrawellness.com/sleep-efficiency-calculator/)"]},{"cell_type":"code","execution_count":26,"id":"234b8fd2","metadata":{"execution":{"iopub.execute_input":"2024-04-14T12:53:28.517694Z","iopub.status.busy":"2024-04-14T12:53:28.515996Z","iopub.status.idle":"2024-04-14T12:53:28.539097Z","shell.execute_reply":"2024-04-14T12:53:28.537102Z"},"papermill":{"duration":0.061359,"end_time":"2024-04-14T12:53:28.541905","exception":false,"start_time":"2024-04-14T12:53:28.480546","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["   Min. 1st Qu.  Median    Mean 3rd Qu.    Max. \n","  49.84   91.18   94.26   91.65   96.06  100.00 "]},"metadata":{},"output_type":"display_data"}],"source":["daily_activity_sleep <- daily_activity_sleep %>%\n","  mutate(sleep_efficiency = totalminutesasleep / totaltimeinbed * 100)\n","summary(daily_activity_sleep$sleep_efficiency)"]},{"cell_type":"code","execution_count":27,"id":"a83f71e6","metadata":{"execution":{"iopub.execute_input":"2024-04-14T12:53:28.61526Z","iopub.status.busy":"2024-04-14T12:53:28.613416Z","iopub.status.idle":"2024-04-14T12:53:28.715713Z","shell.execute_reply":"2024-04-14T12:53:28.713591Z"},"papermill":{"duration":0.140787,"end_time":"2024-04-14T12:53:28.718449","exception":false,"start_time":"2024-04-14T12:53:28.577662","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdaVxUZR/G8XsYdtlBZXNPxR23RMmUUBRzX1Nxx9I018pyt82lXDPNNRVTHyvN\nDcUlMBW0cssNxQVLRQUUUGSdmecFhoQwHIyZM4y/7ws/wzn3DBfzeeK5OGfO/yg0Go0AAABA\n6WcidwAAAACUDIodAACAkaDYAQAAGAmKHQAAgJGg2AEAABgJih0AAICRoNgBAAAYCYodAACA\nkaDYAQAAGAmKHQAAgJGg2AEAABgJih0AAICRoNgBAAAYCYodA