,"  mutate(labels = scales::percent(total_percent))\n","\n","# Filter for low use category\n","minutes_worn_lowuse <- minutes_worn %>%\n","  filter(usage == \"low use\") %>%\n","  group_by(worn) %>%\n","  summarise(total = n()) %>%\n","  mutate(totals = sum(total)) %>%\n","  group_by(worn) %>%\n","  summarise(total_percent = total / totals) %>%\n","  mutate(labels = scales::percent(total_percent))\n","\n","# Set the factor levels for worn variable\n","worn_levels <- c(\"All day\", \"More than half day\", \"Less than half day\")\n","\n","# Create the four pie charts\n","chart_percent <- ggplot(minutes_worn_percent, aes(x = \"\", y = total_percent, fill = worn)) +\n","  geom_bar(stat = \"identity\", width = 1, color = \"white\") +\n","  coord_polar(\"y\", start = 0) +\n","  geom_text(aes(label = labels), position = position_stack(vjust = 0.5)) +\n","  scale_fill_manual(values = custom_colors) +\n","  labs(title = \"All Usage Categories\", x = NULL, y = NULL) +\n","  theme_void() +\n","  theme(legend.position = \"right\")\n","\n","chart_highuse <- ggplot(minutes_worn_highuse, aes(x = \"\", y = total_percent, fill = worn)) +\n","  geom_bar(stat = \"identity\", width = 1, color = \"white\") +\n","  coord_polar(\"y\", start = 0) +\n","  geom_text(aes(label = labels), position = position_stack(vjust = 0.5)) +\n","  scale_fill_manual(values = custom_colors) +\n","  labs(title = \"High Use Category\", x = NULL, y = NULL) +\n","  theme_void() +\n","  theme(legend.position = \"right\")\n","\n","chart_moduse <- ggplot(minutes_worn_moduse, aes(x = \"\", y = total_percent, fill = worn)) +\n","  geom_bar(stat = \"identity\", width = 1, color = \"white\") +\n","  coord_polar(\"y\", start = 0) +\n","  geom_text(aes(label = labels), position = position_stack(vjust = 0.5)) +\n","  scale_fill_manual(values = custom_colors) +\n","  labs(title = \"Moderate Use Category\", x = NULL, y = NULL) +\n","  theme_void() +\n","  theme(legend.position = \"right\")\n","\n","chart_lowuse <- ggplot(minutes_worn_lowuse, aes(x = \"\", y = total_percent, fill = worn)) +\n","  geom_bar(stat = \"identity\", width = 1, color = \"white\") +\n","  coord_polar(\"y\", start = 0) +\n","  geom_text(aes(label = labels), position = position_stack(vjust = 0.5)) +\n","  scale_fill_manual(values = custom_colors) +\n","  labs(title = \"Low Use Category\", x = NULL, y = NULL) +\n","  theme_void() +\n","  theme(legend.position = \"right\")\n","\n","# Display the four pie charts\n","chart_percent\n","chart_highuse\n","chart_moduse\n","chart_lowuse\n","\n"," \n","# # Print the minutes_worn_percent data frame\n","# print(minutes_worn_percent)\n","# # Print the minutes_worn_highuse data frame\n","# print(minutes_worn_highuse)\n","# # Print the minutes_worn_moduse data frame\n","# print(minutes_worn_moduse)\n","# # Print the minutes_worn_lowuse data frame\n","# print(minutes_worn_lowuse)"]},{"cell_type":"markdown","id":"04f6f30b","metadata":{"papermill":{"duration":0.041188,"end_time":"2024-04-14T12:53:31.979244","exception":false,"start_time":"2024-04-14T12:53:31.938056","status":"completed"},"tags":[]},"source":["# All Usage Categories:\n","\n","* The majority of users wear the device for more than half the day (60%), indicating a significant duration of usage.\n","* Wearing the device all day accounts for 36.5% of the total usage time.\n","* Wearing the device less than half the day is the least common, representing only 3.51% of the total usage time.\n","\n","# High Use Category (21-31 days of device usage):\n","\n","* Within this category, users predominantly wear the device for more than half the day (88.9%), suggesting extensive and continuous usage.\n","* Wearing the device all day represents a smaller percentage (6.76%).\n","* Wearing the device less than half the day is the least common, accounting for only 4.32% of the total usage time.\n","\n","# Moderate Use Category (10-20 days of device usage):\n","\n","* Users in this category display a similar trend to the high use category, with a majority wearing the device for more than half the day (69.3%).\n","* Wearing the device all day is also significant, representing 26.7% of the total usage time.\n","* Wearing the device less than half the day is the least common, comprising 4% of the total usage time.\n","# Low Use Category (1-10 days of device usage):\n","\n","* Within this category, the majority of users wear the device all day (80.2%), indicating a tendency to utilize the device for extended periods when it is used.\n","* Wearing the device more than half the day represents a smaller percentage (17.5%).\n","* Wearing the device less than half the day is the least common, accounting for only 2.24% of the total usage time."]},{"cell_type":"markdown","id":"674177d6","metadata":{"papermill":{"duration":0.04026,"end_time":"2024-04-14T12:53:32.05935","exception":false,"start_time":"2024-04-14T12:53:32.01909","status":"completed"},"tags":[]},"source":["The majority of users wear the device for extended durations, whether in the high use, moderate use, or low use categories. However, as the frequency of device usage decreases from high use to low use categories, the percentage of individuals wearing the device all day increases. Conversely, the percentage of individuals wearing the device less than half the day generally decreases as the usage category shifts from high use to low use."]},{"cell_type":"markdown","id":"6c2bb99a","metadata":{"papermill":{"duration":0.039917,"end_time":"2024-04-14T12:53:32.138707","exception":false,"start_time":"2024-04-14T12:53:32.09879","status":"completed"},"tags":[]},"source":["# 6. Conclusion <a class=\"anchor\" id=\"6\">"]},{"cell_type":"markdown","id":"d466a9e5","metadata":{"papermill":{"duration":0.039428,"end_time":"2024-04-14T12:53:32.218002","exception":false,"start_time":"2024-04-14T12:53:32.178574","status":"completed"},"tags":[]},"source":["**Based on the analysis of FitBit Fitness Tracker Data, several insights have been uncovered that can significantly impact Bellabeat's marketing strategy.**"]},{"cell_type":"markdown","id":"61d7c4ba","metadata":{"papermill":{"duration":0.039186,"end_time":"2024-04-14T12:53:32.296719","exception":false,"start_time":"2024-04-14T12:53:32.257533","status":"completed"},"tags":[]},"source":["### Recommendation: Encouraging Users to Achieve 10,000 Daily Steps\n","Based on our analysis, it has been observed that the average daily step count among our users exceeds 7,500 steps. To further promote physical activity and improve user engagement, we recommend implementing a program that encourages users to aim for 10,000 steps daily. In cases where users fall short of this target, the following strategies can be employed:\n","\n","**Goal Setting:** Integrate a feature into the app that allows users to set personalized step goals, encouraging them to aim for 10,000 steps per day. This feature should emphasize the benefits of regular physical activity and provide a sense of accomplishment when milestones are reached.\n","\n","**Real-time tracking and reminders:** Provides users with real-time step tracking and regular reminders to keep them informed of their progress. Push notifications can serve as motivational reminders, urging users to stay active and work toward their daily step goals.\n","\n","**Rewards and Incentives:** Implement a reward system to incentivize user participation and effort. Milestone rewards or virtual badges can be awarded to users for achieving specific step milestones or consistently achieving daily goals. This gamification element fosters a sense of accomplishment and motivates users to maintain an active lifestyle.\n","\n","#### For users who are having trouble reaching their 10,000-step goal, here are some strategies:\n","\n","**Progressive Goal Setting:** Implement a staged goal setting approach for users who are new to walking or have lower activity levels. Gradually increasing step goals over time prevents feelings of discouragement and allows users to gradually increase their activity levels.\n","\n","**Personalized Recommendations:** Provides personalized recommendations and tips based on the user's walking history and activity level. This can include tailored walking plans, encouraging reminders and appropriate challenges designed to help users achieve their goals step by step.\n"]},{"cell_type":"markdown","id":"80227513","metadata":{"papermill":{"duration":0.039599,"end_time":"2024-04-14T12:53:32.375725","exception":false,"start_time":"2024-04-14T12:53:32.336126","status":"completed"},"tags":[]},"source":["### Recommendation: Implementing Sleep Cycle-Based Wake-Up Feature\n","\n","Based on the analysis of the data, it is evident that the average sleep duration among users falls below 8 hours per day. This finding highlights the potential opportunity to prioritize and encourage better sleep habits among our user base. To address this, the following recommendations are proposed:\n","\n","**Smart Alarm Clock Function:** Implement a smart alarm clock function that uses sleep cycle data to wake up the user at the best time within the user's sleep cycle. Applications can calculate the ideal wake window based on the average duration of sleep cycles, taking into account the desired wake time set by the user. Alarms can be set to sound during light sleep, which helps smooth the transition from sleep to wakefulness and minimizes grogginess upon waking.\n","\n","**Sleep Cycle Tracking:** Enhance the app’s sleep tracking functionality to accurately detect and analyze users’ sleep cycles. This can be achieved by leveraging advanced algorithms and sensor data from compatible devices such as smartwatches or wearable sleep trackers\n"]},{"cell_type":"markdown","id":"dc1d1329","metadata":{"papermill":{"duration":0.039961,"end_time":"2024-04-14T12:53:32.456151","exception":false,"start_time":"2024-04-14T12:53:32.41619","status":"completed"},"tags":[]},"source":["### Recommendation: Personalized Calorie Tracking and Goal Setting\n","Based on the analysis of daily calorie consumption data, we recommend implementing personalized calorie tracking and goal setting features in the app to help users effectively manage calorie intake and achieve health and fitness goals. The following suggestions are made:\n","\n","**Personalized Calorie Targets:** Introducing personalized calorie targets tailored to each user’s individual needs and goals. Giving users customized calorie goals considering factors such as age, gender, weight, height, activity level and desired weight management goals. These goals can be adjusted over time as users progress toward desired outcomes.\n","\n","**Expanded Activity Database:** Enrich the existing activity database within the application to include a wide range of sports and physical activities."]},{"cell_type":"markdown","id":"d1d7342b","metadata":{"papermill":{"duration":0.039015,"end_time":"2024-04-14T12:53:32.535015","exception":false,"start_time":"2024-04-14T12:53:32.496","status":"completed"},"tags":[]},"source":["# Risk and Concerns:\n","The analysis may be affected by sample size bias due to varying sample sizes, time frame bias because of the limited duration of data collection, and temporal bias as the data is from 2016 and may not reflect current circumstances.\n","\n"]},{"cell_type":"code","execution_count":null,"id":"255f0795","metadata":{"papermill":{"duration":0.040535,"end_time":"2024-04-14T12:53:32.616267","exception":false,"start_time":"2024-04-14T12:53:32.575732","status":"completed"},"tags":[]},"outputs":[],"source":[]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":7746251,"sourceType":"datasetVersion"}],"dockerImageVersionId":30530,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":